import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Register from './pages/Register';
import Login from './pages/Login';
import Home from './pages/Home';
import Dashboard from './pages/Dashboard';
import AdminDashboard from './pages/AdminDashboard';
import AdminLogin from './pages/AdminLogin';
import Browse from './pages/Browse';
import AllPlaces from './pages/AllPlaces';
import Analysis from './pages/Analysis';
import UserAnalysis from './pages/UserAnalysis';
import AddExperiences from './pages/AddExperiences';
import CreatedExperiences from './pages/CreatedExperiences';
import RequireAuth from './components/RequireAuth';
import { NotificationsProvider } from './contexts/NotificationsContext';

export default function App() {
  return (
    <NotificationsProvider>
      <Routes>
        <Route path="/" element={<Navigate to="/home" replace />} />
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <Route path="/admin-login" element={<AdminLogin />} />
        <Route path="/home" element={
          <RequireAuth>
            <Home />
          </RequireAuth>
        } />
        <Route path="/browse" element={
          <RequireAuth>
            <Browse />
          </RequireAuth>
        } />
        <Route path="/all-places" element={
          <RequireAuth>
            <AllPlaces />
          </RequireAuth>
        } />
        <Route path="/dashboard" element={
          <RequireAuth>
            <Dashboard />
          </RequireAuth>
        } />
        <Route path="/admin" element={
          <RequireAuth>
            <AdminDashboard />
          </RequireAuth>
        } />
        <Route path="/analysis" element={
          <RequireAuth>
            <Analysis />
          </RequireAuth>
        } />
        <Route path="/analysis/:id" element={
          <RequireAuth>
            <UserAnalysis />
          </RequireAuth>
        } />
        <Route path="/add-experiences" element={
          <RequireAuth>
            <AddExperiences />
          </RequireAuth>
        } />
        <Route path="/created-experiences" element={
          <RequireAuth>
            <CreatedExperiences />
          </RequireAuth>
        } />
        <Route path="*" element={<div className="container"><h2>Page not found</h2></div>} />
      </Routes>
    </NotificationsProvider>
  );
}
